;; **
;;; ## Polynomial
;; **

;; @@
(def xs (range 0.0 30.0 1.0))
(def coords (mapv (fn [x] [x]) xs))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.spea2/coords</span>","value":"#'algebolic.demo.spea2/coords"}
